          display: "inline-block"
        }}
      >
        All rights reserved to Meridja Nassim @2019
      </p>
      <p>
        Built with ReactJS 16 <i className="devicon-react-original colored"></i>
      </p>
      <p>
        Design Inspired from{" "}
        <a href="http://cvresumetemplate.com/maha-personal-cv-resume-html-template/home-one.html">
          <i>Moha-Personal CV</i>
        </a>
      </p>
    </div>
  );
};

export default AppInfo;
